import './Expeneses.css';
import ExpenseItem from './ExpenseItem';
function Expenses(props) {
    return (
        <div className="expenses">
            <h2>Let's get started!</h2>

            <ExpenseItem title={
                    props.items[0].expenseTitle
                }
                amount={
                    props.items[0].amount
                }
                date={
                    props.items[0].date
            }></ExpenseItem>
            <ExpenseItem title={
                    props.items[1].expenseTitle
                }
                amount={
                    props.items[1].amount
                }
                date={
                    props.items[1].date
            }></ExpenseItem>
            <ExpenseItem title={
                    props.items[2].expenseTitle
                }
                amount={
                    props.items[2].amount
                }
                date={
                    props.items[2].date
            }></ExpenseItem>

        </div>
    );
}

export default Expenses;
